  apiKey: "AIzaSyAKmAT-LmBNkHx36pzAlipWDzzEID7aifc",
  authDomain: "chat-auth-e7046.firebaseapp.com",
  projectId: "chat-auth-e7046",
  storageBucket: "chat-auth-e7046.appspot.com",
  messagingSenderId: "638756670186",
